cypher:
MATCH (o:Organization)-[:IN_CITY]->(c:City)-[:IN_COUNTRY]->(co:Country)
WHERE o.nbrEmployees > 10000 AND NOT EXISTS {
    MATCH (capital:City)-[:IN_COUNTRY {capital: true}]->(co)
    WHERE c = capital
}
RETURN o.name AS OrganizationName, o.nbrEmployees AS NumberOfEmployees, c.name AS CityName, co.name AS CountryName

MATCH (org:Organization)-[:IN_CITY]->(city:City)-[:IN_COUNTRY]->(country:Country)
WHERE NOT EXISTS {
  MATCH (capital:City)-[:IN_COUNTRY {capital: true}]->(country)
  WHERE city = capital
}
RETURN org.name AS organizationName, city.name AS cityName, country.name AS countryName

MATCH (org:Organization)-[:IN_CITY]->(city:City)-[:IN_COUNTRY]->(country:Country)
WHERE NOT EXISTS {
    MATCH (capitalCity:City)-[:IN_COUNTRY {isCapital: true}]->(country)
    WHERE city = capitalCity
}
RETURN org.name AS organizationName, city.name AS cityName, country.name AS countryName
